import React from "react";
import { BrowserRouter, Route, Router } from "react-router-dom";

const Root = () => {
  return (
    <BrowserRouter>
      <div>
        <Router>
          <Route path="/home" element={

          <span>home</span>
          }/>

          <span>about</span>
          <span>contact</span>
        </Router>
      </div>
    </BrowserRouter>
  );
};

export default Root;
